import React from 'react'
import axios from 'axios'

class Plan extends React.Component
{
    constructor(props) {
        super(props);
        this.state = {
            monday: [],
            tuesday: [],
            wednesday: [],
            thursday: [],
            friday: [],
            saturday: [],
            sunday: []
        }
    }

    async componentDidMount() {
        let monday, tuesday, thursday, friday, saturday, sunday, tasks;
        await axios.get("http://localhost:5000/get-tasks")
            .then((res) => { tasks = res.data })
            .then(() => {
              tasks.map((item) => {
                 switch(item.day)
                 {
                     case 'Monday':
                         this.setState({
                             monday: [...this.state.monday, item]
                         });
                         break;
                     case "Tuesday":
                         tuesday.add(item);
                         break;
                     case 'Wednesday':
                         this.setState({
                             wednesday: [...this.state.wednesday, item]
                         });
                         break;
                     case 'Thursday':
                         thursday.add(item);
                         break;
                     case 'Friday':
                         friday.add(item);
                         break;
                     case 'Saturday':
                         saturday.add(item);
                         break;
                     case 'Sunday':
                         sunday.add(item);
                         break;
                     default:
                         break;
                 }
              });
            });
    }

    render() {
        return (
            <div className="plan">
                <div className="dayContainer">
                    <h3>Monday</h3>
                    <ul className="dayList">
                        <li className="item"><span className="task">Example thing</span><span className="duration">120 min</span></li>
                        <li className="item"><span className="task">Example thing</span><span className="duration">120 min</span></li>
                    </ul>
                </div>
                <div className="dayContainer">
                    <h3>Tuesday</h3>
                    <ul className="dayList">
                        <li className="item"><span className="task">Example thing</span><span className="duration">120 min</span></li>
                    </ul>
                </div>
                <div className="dayContainer">
                    <h3>Wednesday</h3>
                    <ul className="dayList">
                        <li className="item"><span className="task">Example thing</span><span className="duration">120 min</span></li>
                    </ul>
                </div>
                <div className="dayContainer">
                    <h3>Thursday</h3>
                    <ul className="dayList">
                        <li className="item"><span className="task">Example thing</span><span className="duration">120 min</span></li>
                    </ul>
                </div>
                <div className="dayContainer">
                    <h3>Friday</h3>
                    <ul className="dayList">
                        <li className="item"><span className="task">Example thing</span><span className="duration">120 min</span></li>
                    </ul>
                </div>
                <div className="dayContainer">
                    <h3>Saturday</h3>
                    <ul className="dayList">
                        <li className="item"><span className="task">Example thing</span><span className="duration">120 min</span></li>
                    </ul>
                </div>
                <div className="dayContainer">
                    <h3>Sunday</h3>
                    <ul className="dayList">
                        <li className="item"><span className="task">Example thing</span><span className="duration">120 min</span></li>
                    </ul>
                </div>
            </div>);
    }
}

export default Plan;
